--
-- Name: user_with_most_orders _RETURN; Type: RULE; Schema: public; Owner: postgres
--

CREATE OR REPLACE VIEW public.user_with_most_orders AS
 SELECT dimpro_order.user_id,
    dimpro_user.email,
    dimpro_user.name,
    count(*) AS order_count
   FROM (public.dimpro_order
     LEFT JOIN public.dimpro_user ON ((dimpro_order.user_id = dimpro_user.id)))
  GROUP BY dimpro_order.user_id, dimpro_user.id
  ORDER BY (count(*)) DESC
 LIMIT 1;


--
-- Name: most_ordered_product _RETURN; Type: RULE; Schema: public; Owner: postgres
--

CREATE OR REPLACE VIEW public.most_ordered_product AS
 SELECT dimpro_order_product.product_id,
    dimpro_product.item,
    count(*) AS order_count
   FROM (public.dimpro_order_product
     JOIN public.dimpro_product ON ((dimpro_order_product.product_id = dimpro_product.id)))
  GROUP BY dimpro_order_product.product_id, dimpro_product.id
  ORDER BY (count(*)) DESC;


